I have here a Romarm, Wasr-10/63 Ak47, caliber 7.62x39. Less than 500 rounds through it. Has been field stripped and cleaned well after its last fire. Has side mount for an Ak side rail optics mount. Comes with two tapco mags, one 20 round, one 30 round. Has tapco upper and lower w/picatinny rail and a tapco collapsible stock w/ two sling attachments on the stock for a sling. I also have the regular wood furniture (wood stock w/thumb hole & wood upper&lower) to come with it if needed. If interested; 
TEXT OR CALL : REDACTED
